import React from "react";
import { Card } from "react-bootstrap";

const TableChoferesHead = () => {
  return (
    <>
      <Card.Title as="h4">Aqui av el titulo de la tabla </Card.Title>
      <p className="card-category">Este es el subititulo</p>
    </>
  );
};

export default TableChoferesHead;
